import { faBlog, faHeart, faHome } from '@fortawesome/free-solid-svg-icons';
import { SideButton } from '../components/SideButton';

function NavSidebar() {
    return (
        <div className="wrapper">
            <SideButton children={'Trang chủ'} icon={faHome} active link="/" />
            <SideButton children={'Danh sách yêu thích'} icon={faHeart} />
            <SideButton children={'Blog'} icon={faBlog} />
        </div>
    );
}

export default NavSidebar;
